import React from "react";
import { Panel, Table } from "rsuite";

const Home = () => {
  const imgStyles = {
    height: "20rem",
    width: "100%",
  };
  const { Column, HeaderCell, Cell } = Table;
  return (
    <div
      style={{
        padding: "1.3rem",
        display: "flex",
        justifyContent: "space-between",
      }}
    >
      <div className="leftSide">
        <Panel
          shaded
          bordered
          bodyFill
          style={{
            display: "inline-block",
            width: "100%",
          }}
        >
          <img style={imgStyles} src="https://via.placeholder.com/500" />
          <Panel header="Latest Changes">
            <Table>
              <Column align="Center" fixed>
                <HeaderCell>Project</HeaderCell>
                <Cell dataKey="project_name" />
              </Column>
              <Column align="Center" fixed>
                <HeaderCell>Section</HeaderCell>
                <Cell dataKey="code" />
              </Column>
              <Column align="Center" fixed>
                <HeaderCell>Snippet</HeaderCell>
                <Cell dataKey="snippet" />
              </Column>
              <Column align="Center" fixed>
                <HeaderCell>Date</HeaderCell>
                <Cell dataKey="date" />
              </Column>
            </Table>
          </Panel>
        </Panel>
      </div>
      <div className="rightSide">
        <Panel
          shaded
          bordered
          bodyFill
          style={{
            width: "100%",
            padding: "1rem",
          }}
        >
            <div style={{display: "flex"}}>
          <Panel
            header="Project One"
            style={{
              marginBottom: "1rem",
              width: "48%"
            }}
            collapsible
            bordered
          >
            <p>This is some filler text</p>
          </Panel>
          <Panel
            header="Project Two"
           style={{
              marginBottom: "1rem",
              width: "48%"
            }}
            collapsible
            bordered
          >
            <p>This is some filler text</p>
          </Panel>
          </div>
        </Panel>
      </div>
    </div>
  );
};

export default Home;
